// src/App.jsx
// ... (previous code)

const App = () => {
  return (
    <Router>
      <div>
        {/* Conditionally render the Navbar based on the route */}
        <Routes>
          <Route
            path="/casual/*"
            element={
              <AppWithNavbar navbar={<NavbarCasual />} isCasual={true} isProfessional={false}>
                <Portfolio isCasual={true} isProfessional={false} />
              </AppWithNavbar>
            }
          />
          <Route
            path="/professional/*"
            element={
              <AppWithNavbar navbar={<NavbarProfessional />} isCasual={false} isProfessional={true}>
                <Portfolio isCasual={false} isProfessional={true} />
              </AppWithNavbar>
            }
          />
          <Route
            path="/Portfolio/*"
            element={
              <AppWithNavbar navbar={<NavbarCasual />} isCasual={true} isProfessional={false}>
                <Portfolio isCasual={true} isProfessional={false} />
              </AppWithNavbar>
            }
          />
        </Routes>

        {/* Define your other routes */}
        <Routes>
          <Route
            path="/casual/*"
            element={
              <AppWithNavbar navbar={<NavbarCasual />} isCasual={true} isProfessional={false}>
                <Contact isCasual={true} isProfessional={false} />
              </AppWithNavbar>
            }
          />
          <Route
            path="/professional/*"
            element={
              <AppWithNavbar navbar={<NavbarProfessional />} isCasual={false} isProfessional={true}>
                <Contact isCasual={false} isProfessional={true} />
              </AppWithNavbar>
            }
          />
          <Route
            path="/Contact/*"
            element={
              <AppWithNavbar navbar={<NavbarCasual />} isCasual={true} isProfessional={false}>
                <Contact isCasual={true} isProfessional={false} />
              </AppWithNavbar>
            }
          />
          {/* ... other routes */}
        </Routes>
      </div>
    </Router>
  );
};

